INSERT INTO `` (`id`,`turkce`,`ing`,`konu`,`ses`,`okunus`,`ornekler`,`1_tarih`,`1_seviye`,`2_tarih`,`2_seviye`) VALUES (4,'rüzgar','wind','hava durumu','https://api.dictionaryapi.dev/media/pronunciations/en/wind-1-uk.mp3','/ˈwaɪnd/','\"[{\\\"partOfSpeech\\\": \\\"noun\\\", \\\"definitions\\\": [{\\\"definition\\\": \\\"Real or perceived movement of atmospheric air usually caused by convection or differences in air pressure.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"As they accelerated onto the motorway, the wind tore the plywood off the car\'s roof-rack.\\\"}, {\\\"definition\\\": \\\"Air artificially put in motion by any force or action.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"the wind of a cannon ball;\\\\u00a0 the wind of a bellows\\\"}, {\\\"definition\\\": \\\"The ability to breathe easily.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"After the second lap he was already out of wind.\\\"}, {\\\"definition\\\": \\\"News of an event, especially by hearsay or gossip. (Used with catch, often in the past tense.)\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"Steve caught wind of Martha\'s dalliance with his best friend.\\\"}, {\\\"definition\\\": \\\"One of the five basic elements in Indian and Japanese models of the Classical elements).\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"Flatus.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"Eww. Someone just passed wind.\\\"}, {\\\"definition\\\": \\\"Breath modulated by the respiratory and vocal organs, or by an instrument.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"The woodwind section of an orchestra. Occasionally also used to include the brass section.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A direction from which the wind may blow; a point of the compass; especially, one of the cardinal points, which are often called the \\\\\\\"four winds\\\\\\\".\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"Types of playing-tile in the game of mah-jongg, named after the four winds.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A disease of sheep, in which the intestines are distended with air, or rather affected with a violent inflammation. It occurs immediately after shearing.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"Mere breath or talk; empty effort; idle words.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A bird, the dotterel.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"The region of the solar plexus, where a blow may paralyze the diaphragm and cause temporary loss of breath or other injury.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}], \\\"synonyms\\\": [\\\"gas\\\", \\\"breeze\\\", \\\"draft\\\", \\\"gale\\\"], \\\"antonyms\\\": []}, {\\\"partOfSpeech\\\": \\\"verb\\\", \\\"definitions\\\": [{\\\"definition\\\": \\\"To blow air through a wind instrument or horn to make a sound.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To cause (someone) to become breathless, as by a blow to the abdomen, or by physical exertion, running, etc.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"The boxer was winded during round two.\\\"}, {\\\"definition\\\": \\\"To cause a baby to bring up wind by patting its back after being fed.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To turn a boat or ship around, so that the wind strikes it on the opposite side.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To expose to the wind; to winnow; to ventilate.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To perceive or follow by scent.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\