INSERT INTO `` (`id`,`turkce`,`ing`,`konu`,`ses`,`okunus`,`ornekler`,`1_tarih`,`1_seviye`,`2_tarih`,`2_seviye`) VALUES (11,'kız kardeş','Sister','aile üyeleri','https://api.dictionaryapi.dev/media/pronunciations/en/sister-uk.mp3','/ˈsɪs.tə/','\"[{\\\"partOfSpeech\\\": \\\"noun\\\", \\\"definitions\\\": [{\\\"definition\\\": \\\"A daughter of the same parents as another person; a female sibling.\\\", \\\"synonyms\\\": [\\\"sis\\\"], \\\"antonyms\\\": [\\\"brother\\\"], \\\"example\\\": \\\"My sister is always driving me crazy.\\\"}, {\\\"definition\\\": \\\"A female member of a religious order; especially one devoted to more active service; (informally) a nun.\\\", \\\"synonyms\\\": [\\\"nun\\\", \\\"sistren\\\"], \\\"antonyms\\\": [], \\\"example\\\": \\\"Michelle left behind her bank job and became a sister at the local convent.\\\"}, {\\\"definition\\\": \\\"Any butterfly in the genus Adelpha, so named for the resemblance of the dark-colored wings to the black habit traditionally worn by nuns.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A senior or supervisory nurse, often in a hospital.\\\", \\\"synonyms\\\": [\\\"charge nurse\\\"], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"Any woman or girl with whom a bond is felt through common membership of a race, profession, religion or organization, such as feminism.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"Connie was very close to her friend Judy and considered her to be her sister.\\\"}, {\\\"definition\\\": \\\"(sometimes capitalized) A black woman.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A form of address to a woman.\\\", \\\"synonyms\\\": [\\\"darling\\\", \\\"dear\\\", \\\"lady\\\", \\\"love\\\", \\\"miss\\\", \\\"pet\\\"], \\\"antonyms\\\": [], \\\"example\\\": \\\"What\\\\u2019s up, sister?\\\"}, {\\\"definition\\\": \\\"A woman, in certain labour or socialist circles; also as a form of address.\\\", \\\"synonyms\\\