INSERT INTO `` (`id`,`turkce`,`ing`,`konu`,`ses`,`okunus`,`ornekler`,`1_tarih`,`1_seviye`,`2_tarih`,`2_seviye`) VALUES (89,'yüz',' face','vücut','https://api.dictionaryapi.dev/media/pronunciations/en/face-au.mp3','/feɪs/','\"[{\\\"partOfSpeech\\\": \\\"noun\\\", \\\"definitions\\\": [{\\\"definition\\\": \\\"The front part of the head of a human or other animal, featuring the eyes, nose and mouth, and the surrounding area.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"That girl has a pretty face.\\\"}, {\\\"definition\\\": \\\"One\'s facial expression.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"Why the sad face?\\\"}, {\\\"definition\\\": \\\"(in expressions such as \'make a face\') A distorted facial expression; an expression of displeasure, insult, etc.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"Children! Stop making faces at each other!\\\"}, {\\\"definition\\\": \\\"The public image; outward appearance.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"He managed to show a bold face despite his embarrassment.\\\"}, {\\\"definition\\\": \\\"The frontal aspect of something.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"The face of the cliff loomed above them.\\\"}, {\\\"definition\\\": \\\"An aspect of the character or nature of someone or something.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"Poverty is the ugly face of capitalism.\\\"}, {\\\"definition\\\": \\\"Presence; sight; front.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"to fly in the face of danger\\\"}, {\\\"definition\\\": \\\"The directed force of something.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"They turned the boat into the face of the storm.\\\"}, {\\\"definition\\\": \\\"Good reputation; standing in the eyes of others; dignity; prestige. (See lose face, save face).\\\", \\\"synonyms\\\": [], \\\"