INSERT INTO `` (`id`,`turkce`,`ing`,`konu`,`ses`,`okunus`,`ornekler`,`1_tarih`,`1_seviye`,`2_tarih`,`2_seviye`) VALUES (182,'çanta','bag','seyahat','https://api.dictionaryapi.dev/media/pronunciations/en/bag-au.mp3','/ˈbæːɡ/','\"[{\\\"partOfSpeech\\\": \\\"noun\\\", \\\"definitions\\\": [{\\\"definition\\\": \\\"A flexible container made of cloth, paper, plastic, etc.\\\", \\\"synonyms\\\": [\\\"poke\\\", \\\"sack\\\", \\\"tote\\\"], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A handbag\\\", \\\"synonyms\\\": [\\\"handbag\\\", \\\"purse\\\"], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A suitcase.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A schoolbag, especially a backpack.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"One\\\\u2019s preference.\\\", \\\"synonyms\\\": [\\\"cup of tea\\\", \\\"thing\\\"], \\\"antonyms\\\": [], \\\"example\\\": \\\"Acid House is not my bag: I prefer the more traditional styles of music.\\\"}, {\\\"definition\\\": \\\"An ugly woman.\\\", \\\"synonyms\\\": [\\\"dog\\\", \\\"hag\\\"], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"The cloth-covered pillow used for first, second, and third base.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"The grounder hit the bag and bounced over the fielder\\\\u2019s head.\\\"}, {\\\"definition\\\": \\\"First, second, or third base.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"He headed back to the bag.\\\"}, {\\\"definition\\\": \\\"(preceded by \\\\\\\"the\\\\\\\") A breathalyzer, so named because it formerly had a plastic bag over the end to measure a set amount of breath.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A collection of objects, disregarding order, but (unlike a set) in which elements may be repeated.\\\", \\\"synonyms\\\": [\\\"multiset\\\"], \\\"antonyms\\\": [], \\\"example\\\": \\\"If one has a bag of three apples and the letter \'a\' is taken to denote \'apple\', then such bag could be represented symbolically as {a,a,a}. Note that in an ordinary context, when talking about a bag of apples, one does not care about identifying the individual apples, although one might be interested in distinguishing apples by species, for example, letting \'r\' denote \'red apple\' and \'g\' denote \'green apple\', then a bag of three red apples and two green apples could be denoted as {r,r,r,g,g}.\\\"}, {\\\"definition\\\": \\\"A sac in animal bodies, containing some fluid or other substance.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"the bag of a cow\\\"}, {\\\"definition\\\": \\\"A pouch tied behind a man\'s head to hold the back-hair of a wig; a bag wig.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"The quantity of game bagged in a hunt.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A scrotum.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A unit of measure of cement equal to 94 pounds.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"(chiefly in the plural) A dark circle under the eye, caused by lack of sleep, drug addiction etc.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A small envelope that contains drugs, especially narcotics.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"\\\\u00a31000, a grand.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A large number or amount.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}], \\\"synonyms\\\": [\\\"cup of tea\\\", \\\"thing\\\", \\\"dog\\\", \\\"hag\\\", \\\"handbag\\\", \\\"purse\\\", \\\"multiset\\\", \\\"poke\\\", \\\"sack\\\", \\\"tote\\\"], \\\"antonyms\\\": []}, {\\\"partOfSpeech\\\": \\\"verb\\\", \\\"definitions\\\": [{\\\"definition\\\": \\\"To put into a bag.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To catch or kill, especially when fishing or hunting.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"We bagged three deer yesterday.\\\"}, {\\\"definition\\\": \\\"To gain possession of something, or to make first claim on something.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To furnish or load with a bag.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"(African American Vernacular) To bring a woman one met on the street with one.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"(African American Vernacular) To laugh uncontrollably.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To criticise sarcastically.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To provide with artificial ventilation via a bag valve mask (BVM) resuscitator.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To fit with a bag to collect urine.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To (cause to) swell or hang down like a full bag.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"The brisk wind bagged the sails.\\\"}, {\\\"definition\\\": \\\"To hang like an empty bag.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"His trousers bag at the knees.\\\"}, {\\\"definition\\\": \\\"To drop away from the correct course.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To swell with arrogance.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To become pregnant.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}], \\\"synonyms\\\": [], \\\"antonyms\\\": []}]\"','2024-04-01',1,'2000-01-01',0);
