INSERT INTO `` (`id`,`turkce`,`ing`,`konu`,`ses`,`okunus`,`ornekler`,`1_tarih`,`1_seviye`,`2_tarih`,`2_seviye`) VALUES (184,'kabin, kamara, kulübe','cabin','seyahat','https://api.dictionaryapi.dev/media/pronunciations/en/cabin-us.mp3','/ˈkæbɪn/','\"[{\\\"partOfSpeech\\\": \\\"noun\\\", \\\"definitions\\\": [{\\\"definition\\\": \\\"A small dwelling characteristic of the frontier, especially when built from logs with simple tools and not constructed by professional builders, but by those who meant to live in it.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"Abraham Lincoln was born in a log cabin.\\\"}, {\\\"definition\\\": \\\"A chalet or lodge, especially one that can hold large groups of people.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A private room on a ship.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"the captain\'s cabin:\\\\u2003 Passengers shall remain in their cabins.\\\"}, {\\\"definition\\\": \\\"The interior of a boat, enclosed to create a small room, particularly for sleeping.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"The passenger area of an airplane.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"(travel) The section of a passenger plane having the same class of service.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A signal box.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A small room; an enclosed place.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"(Indian English) A private office; particularly of a doctor, businessman, lawyer, or other professional.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}], \\\"synonyms\\\": [\\\"cell\\\", \\\"chamber\\\", \\\"hut\\\", \\\"pod\\\", \\\"shack\\\", \\\"shed\\\"], \\\"antonyms\\\": [\\\"hall\\\", \\\"palace\\\", \\\"villa\\\"]}, {\\\"partOfSpeech\\\": \\\"verb\\\", \\\"definitions\\\": [{\\\"definition\\\": \\\"To place in a cabin or other small space.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"(by extension) To limit the scope of.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To live in, or as if in, a cabin; to lodge.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}], \\\"synonyms\\\": [], \\\"antonyms\\\": []}]\"','2024-06-13',3,'2024-04-01',1);
INSERT INTO `` (`id`,`turkce`,`ing`,`konu`,`ses`,`okunus`,`ornekler`,`1_tarih`,`1_seviye`,`2_tarih`,`2_seviye`) VALUES (185,'araba','car','seyahat','https://api.dictionaryapi.dev/media/pronunciations/en/car-uk.mp3','/kɑː/','\"[{\\\"partOfSpeech\\\": \\\"noun\\\", \\\"definitions\\\": [{\\\"definition\\\": \\\"A wheeled vehicle that moves independently, with at least three wheels, powered mechanically, steered by a driver and mostly for personal transportation.\\\", \\\"synonyms\\\": [\\\"auto\\\", \\\"automobile\\\", \\\"carriage\\\", \\\"motor\\\", \\\"motorcar\\\", \\\"vehicle\\\"], \\\"antonyms\\\": [], \\\"example\\\": \\\"She drove her car to the mall.\\\"}, {\\\"definition\\\": \\\"A wheeled vehicle, drawn by a horse or other animal; a chariot.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"An unpowered unit in a railroad train.\\\", \\\"synonyms\\\": [\\\"railcar\\\", \\\"wagon\\\"], \\\"antonyms\\\": [], \\\"example\\\": \\\"The conductor coupled the cars to the locomotive.\\\"}, {\\\"definition\\\": \\\"An individual vehicle, powered or unpowered, in a multiple unit.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"The 11:10 to London was operated by a 4-car diesel multiple unit.\\\"}, {\\\"definition\\\": \\\"A passenger-carrying unit in a subway or elevated train, whether powered or not.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"From the frontmost car of the subway, he filmed the progress through the tunnel.\\\"}, {\\\"definition\\\": \\\"A rough unit of quantity approximating the amount which would fill a railroad car.\\\", \\\"synonyms\\\": [\\\"carload\\\", \\\"wagonload\\\"], \\\"antonyms\\\": [], \\\"example\\\": \\\"We ordered five hundred cars of gypsum.\\\"}, {\\\"definition\\\": \\\"The moving, load-carrying component of an elevator or other cable-drawn transport mechanism.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"Fix the car of the express elevator - the door is sticking.\\\"}, {\\\"definition\\\": \\\"The passenger-carrying portion of certain amusement park rides, such as Ferris wheels.\\\", \\\"synonyms\\\": [\\\"carriage\\\"], \\\"antonyms\\\": [], \\\"example\\\": \\\"The most exciting part of riding a Ferris wheel is when your car goes over the top.\\\"}, {\\\"definition\\\": \\\"The part of an airship, such as a balloon or dirigible, which houses the passengers and control apparatus.\\\", \\\"synonyms\\\": [\\\"basket\\\", \\\"gondola\\\"], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A sliding fitting that runs along a track.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"The aggregate of desirable characteristics of a car.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"Buy now! You can get more car for your money.\\\"}, {\\\"definition\\\": \\\"A floating perforated box for living fish.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}], \\\"synonyms\\\": [\\\"auto\\\", \\\"automobile\\\", \\\"carriage\\\", \\\"motor\\\", \\\"motorcar\\\", \\\"vehicle\\\", \\\"basket\\\", \\\"gondola\\\", \\\"carload\\\", \\\"wagonload\\\", \\\"carriage\\\", \\\"railcar\\\", \\\"wagon\\\"], \\\"antonyms\\\": []}]\"','2000-01-01',0,'2000-01-01',0);
