INSERT INTO `` (`id`,`turkce`,`ing`,`konu`,`ses`,`okunus`,`ornekler`,`1_tarih`,`1_seviye`,`2_tarih`,`2_seviye`) VALUES (188,'kalkış, gidiş, ayrılış','departure','seyahat','https://api.dictionaryapi.dev/media/pronunciations/en/departure-uk.mp3','/dɪˈpɑː(ɹ)tjə(ɹ)/','\"[{\\\"partOfSpeech\\\": \\\"noun\\\", \\\"definitions\\\": [{\\\"definition\\\": \\\"The act of departing or something that has departed.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"The departure was scheduled for noon.\\\"}, {\\\"definition\\\": \\\"A deviation from a plan or procedure.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"There are several significant departures, however, from current practice.\\\"}, {\\\"definition\\\": \\\"A death.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"The distance due east or west made by a ship in its course reckoned in plane sailing as the product of the distance sailed and the sine of the angle made by the course with the meridian.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"The difference in easting between the two ends of a line or curve.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"The area is computed by latitudes and departures.\\\"}, {\\\"definition\\\": \\\"The desertion by a party to any pleading of the ground taken by him in his last antecedent pleading, and the adoption of another.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"Division; separation; putting away.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}], \\\"synonyms\\\": [\\\"leaving\\\"], \\\"antonyms\\\": [\\\"arrival\\\"]}]\"','2024-04-02',1,'2000-01-01',0);
