INSERT INTO `` (`id`,`turkce`,`ing`,`konu`,`ses`,`okunus`,`ornekler`,`1_tarih`,`1_seviye`,`2_tarih`,`2_seviye`) VALUES (209,'dinlenmek','rest','seyahat','https://api.dictionaryapi.dev/media/pronunciations/en/rest-us.mp3','/ɹɛst/','\"[{\\\"partOfSpeech\\\": \\\"noun\\\", \\\"definitions\\\": [{\\\"definition\\\": \\\"(of a person or animal) Relief from work or activity by sleeping; sleep.\\\", \\\"synonyms\\\": [\\\"sleep\\\", \\\"slumber\\\"], \\\"antonyms\\\": [], \\\"example\\\": \\\"I need to get a good rest tonight; I was up late last night.\\\"}, {\\\"definition\\\": \\\"Any relief from exertion; a state of quiet and relaxation.\\\", \\\"synonyms\\\": [\\\"break\\\", \\\"repose\\\", \\\"time off\\\"], \\\"antonyms\\\": [], \\\"example\\\": \\\"We took a rest at the top of the hill to get our breath back.\\\"}, {\\\"definition\\\": \\\"Peace; freedom from worry, anxiety, annoyances; tranquility.\\\", \\\"synonyms\\\": [\\\"peace\\\", \\\"quiet\\\", \\\"roo\\\", \\\"silence\\\", \\\"stillness\\\", \\\"tranquility\\\"], \\\"antonyms\\\": [], \\\"example\\\": \\\"It was nice to have a rest from the phone ringing when I unplugged it for a while.\\\"}, {\\\"definition\\\": \\\"(of an object or concept) A state of inactivity; a state of little or no motion; a state of completion.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"Now that we\'re all in agreement, we can put that issue to rest.\\\"}, {\\\"definition\\\": \\\"A final position after death.\\\", \\\"synonyms\\\": [\\\"peace\\\"], \\\"antonyms\\\": [], \\\"example\\\": \\\"She was laid to rest in the village cemetery.\\\"}, {\\\"definition\\\": \\\"A pause of a specified length in a piece of music.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"Remember there\'s a rest at the end of the fourth bar.\\\"}, {\\\"definition\\\": \\\"A written symbol indicating such a pause in a musical score such as in sheet music.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\