INSERT INTO `` (`id`,`turkce`,`ing`,`konu`,`ses`,`okunus`,`ornekler`,`1_tarih`,`1_seviye`,`2_tarih`,`2_seviye`) VALUES (219,'yolculuk, gezi, seyahat','trip','seyahat','https://api.dictionaryapi.dev/media/pronunciations/en/trip-1-uk.mp3','/tɹɪp/','\"[{\\\"partOfSpeech\\\": \\\"noun\\\", \\\"definitions\\\": [{\\\"definition\\\": \\\"A journey; an excursion or jaunt\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"We made a trip to the beach.\\\"}, {\\\"definition\\\": \\\"A stumble or misstep\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"He was injured due to a trip down the stairs.\\\"}, {\\\"definition\\\": \\\"An error; a failure; a mistake\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A period of time in which one experiences drug-induced reverie or hallucinations\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"He had a strange trip after taking LSD.\\\"}, {\\\"definition\\\": \\\"A faux pas, a social error\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"Intense involvement in or enjoyment of a condition\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"ego trip;\\\\u00a0power trip;\\\\u00a0nostalgia trip;\\\\u00a0guilt trip\\\"}, {\\\"definition\\\": \\\"A mechanical cutout device\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A trip-switch or cut-out\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"It\'s dark because the trip operated.\\\"}, {\\\"definition\\\": \\\"A quick, light step; a lively movement of the feet; a skip\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"trip the light fantastic W\\\"}, {\\\"definition\\\": \\\"A small piece; a morsel; a bit\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"The act of tripping someone, or causing them to lose their footing\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\