INSERT INTO `` (`id`,`turkce`,`ing`,`konu`,`ses`,`okunus`,`ornekler`,`1_tarih`,`1_seviye`,`2_tarih`,`2_seviye`) VALUES (233,'zayıf not','fail',' araç gereç','https://api.dictionaryapi.dev/media/pronunciations/en/fail-us.mp3','/feɪl/','\"[{\\\"partOfSpeech\\\": \\\"noun\\\", \\\"definitions\\\": [{\\\"definition\\\": \\\"Poor quality; substandard workmanship.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"The project was full of fail.\\\"}, {\\\"definition\\\": \\\"A failure (condition of being unsuccessful)\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A failure (something incapable of success)\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A failure, especially of a financial transaction (a termination of an action).\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A failing grade in an academic examination.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}], \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"partOfSpeech\\\": \\\"verb\\\", \\\"definitions\\\": [{\\\"definition\\\": \\\"To be unsuccessful.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"Throughout my life, I have always failed.\\\"}, {\\\"definition\\\": \\\"Not to achieve a particular stated goal. (Usage note: The direct object of this word is usually an infinitive.)\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"The truck failed to start.\\\"}, {\\\"definition\\\": \\\"To neglect.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"The report fails to take into account all the mitigating factors.\\\"}, {\\\"definition\\\": \\\"Of a machine, etc.: to cease to operate correctly.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"After running five minutes, the engine failed.\\\"}, {\\\"definition\\\": \\\"To be wanting to, to be insufficient for, to disappoint, to desert.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To receive one or more non-passing grades in academic pursuits.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"I failed English last year.\\\"}, {\\\"definition\\\": \\\"To give a student a non-passing grade in an academic endeavour.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"The professor failed me because I did not complete any of the course assignments.\\\"}, {\\\"definition\\\": \\\"To miss attaining; to lose.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To be wanting; to fall short; to be or become deficient in any measure or degree up to total absence.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"The crops failed last year.\\\"}, {\\\"definition\\\": \\\"To be affected with want; to come short; to lack; to be deficient or unprovided; used with of.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To fall away; to become diminished; to decline; to decay; to sink.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To deteriorate in respect to vigour, activity, resources, etc.; to become weaker.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"A sick man fails.\\\"}, {\\\"definition\\\": \\\"To perish; to die; used of a person.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To err in judgment; to be mistaken.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To become unable to meet one\'s engagements; especially, to be unable to pay one\'s debts or discharge one\'s business obligation; to become bankrupt or insolvent.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}], \\\"synonyms\\\": [\\\"fall on one\'s face\\\", \\\"flunk\\\"], \\\"antonyms\\\": [\\\"succeed\\\"]}, {\\\"partOfSpeech\\\": \\\"adjective\\\", \\\"definitions\\\": [{\\\"definition\\\": \\\"That is a failure.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}], \\\"synonyms\\\": [], \\\"antonyms\\\": []}]\"','2024-06-13',3,'2000-01-01',0);
