INSERT INTO `` (`id`,`turkce`,`ing`,`konu`,`ses`,`okunus`,`ornekler`,`1_tarih`,`1_seviye`,`2_tarih`,`2_seviye`) VALUES (235,'sınıf, kalite, derece','grade',' araç gereç','https://api.dictionaryapi.dev/media/pronunciations/en/grade-us.mp3','/ɡɹeɪd/','\"[{\\\"partOfSpeech\\\": \\\"noun\\\", \\\"definitions\\\": [{\\\"definition\\\": \\\"A rating.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"I gave him a good grade for effort.\\\"}, {\\\"definition\\\": \\\"The performance of an individual or group on an examination or test, expressed by a number, letter, or other symbol; a score.\\\", \\\"synonyms\\\": [\\\"mark\\\"], \\\"antonyms\\\": [], \\\"example\\\": \\\"He got a good grade on the test.\\\"}, {\\\"definition\\\": \\\"A degree or level of something; a position within a scale; a degree of quality.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A slope (up or down) of a roadway or other passage\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"The grade of this hill is more than 5 percent.\\\"}, {\\\"definition\\\": \\\"A level of primary and secondary education.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"Clancy is entering the fifth grade this year.\\\"}, {\\\"definition\\\": \\\"A student of a particular grade (used with the grade level).\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"The grade fives are on a field trip.\\\"}, {\\\"definition\\\": \\\"An area that has been flattened by a grader (construction machine).\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"The level of the ground.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"This material absorbs moisture and is probably not a good choice for use below grade.\\\"}, {\\\"definition\\\": \\\"A gradian.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"In a linear system of divisors on an n-dimensional variety,