INSERT INTO `` (`id`,`turkce`,`ing`,`konu`,`ses`,`okunus`,`ornekler`,`1_tarih`,`1_seviye`,`2_tarih`,`2_seviye`) VALUES (236,'tarih','history',' araç gereç','https://api.dictionaryapi.dev/media/pronunciations/en/history-uk.mp3','/ˈhɪst(ə)ɹi/','\"[{\\\"partOfSpeech\\\": \\\"noun\\\", \\\"definitions\\\": [{\\\"definition\\\": \\\"The aggregate of past events.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"History repeats itself if we don\\\\u2019t learn from its mistakes.\\\"}, {\\\"definition\\\": \\\"The branch of knowledge that studies the past; the assessment of notable events.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"He teaches history at the university.\\\\u00a0\\\\u00a0 History will not look kindly on these tyrants.\\\\u00a0\\\\u00a0 He dreams of an invention that will make history.\\\"}, {\\\"definition\\\": \\\"A set of events involving an entity.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"What is your medical history?\\\\u00a0\\\\u00a0 The family\'s history includes events best forgotten.\\\"}, {\\\"definition\\\": \\\"A record or narrative description of past events.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"I really enjoyed Shakespeare\'s tragedies more than his histories.\\\"}, {\\\"definition\\\": \\\"A list of past and continuing medical conditions of an individual or family.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"A personal medical history is required for the insurance policy.\\\\u00a0\\\\u00a0 He has a history of cancer in his family.\\\"}, {\\\"definition\\\": \\\"A record of previous user events, especially of visited web pages in a browser.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"I visited a great site yesterday but forgot the URL. Luckily, I didn\'t clear my history.\\\"}, {\\\"definition\\\": \\\"Something that no longer exists or is no longer relevant.\\\", \\\"synonyms\\\": [], \