n material, consisting of two crossing blades attached at a pivot point in such a way that the blades slide across each other when the handles are closed.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"Scissors are used to cut the flowers.\\\"}, {\\\"definition\\\": \\\"An attacking move conducted by two players; the player without the ball runs from one side of the ball carrier, behind the ball carrier, and receives a pass from the ball carrier on the other side.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"They executed a perfect scissors.\\\"}, {\\\"definition\\\": \\\"A method of skating with one foot significantly in front of the other.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"An exercise in which the legs are switched back and forth, suggesting the motion of scissors.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A scissors hold.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"(rock paper scissors) A hand with the index and middle fingers open (a handshape resembling scissors), that beats paper and is loses to rock. It beats lizard and loses to Spock in rock-paper-scissors-lizard-Spock.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}], \\\"synonyms\\\": [\\\"switch\\\", \\\"pair of scissors\\\", \\\"shears\\\"], \\\"antonyms\\\": []}]\"','2024-06-21',3,'2000-01-01',0);
