INSERT INTO `` (`id`,`turkce`,`ing`,`konu`,`ses`,`okunus`,`ornekler`,`1_tarih`,`1_seviye`,`2_tarih`,`2_seviye`) VALUES (253,'öğrenim, ders çalışmak','study',' araç gereç','https://api.dictionaryapi.dev/media/pronunciations/en/study-uk.mp3','/ˈstʌdi/','\"[{\\\"partOfSpeech\\\": \\\"verb\\\", \\\"definitions\\\": [{\\\"definition\\\": \\\"(usually academic) To review materials already learned in order to make sure one does not forget them, usually in preparation for an examination.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"I need to study my biology notes.\\\"}, {\\\"definition\\\": \\\"(academic) To take a course or courses on a subject.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"I study medicine at the university.\\\"}, {\\\"definition\\\": \\\"To acquire knowledge on a subject with the intention of applying it in practice.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"Biologists study living things.\\\"}, {\\\"definition\\\": \\\"To look at minutely.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"He studied the map in preparation for the hike.\\\"}, {\\\"definition\\\": \\\"To fix the mind closely upon a subject; to dwell upon anything in thought; to muse; to ponder.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To endeavor diligently; to be zealous.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}], \\\"synonyms\\\": [\\\"con\\\", \\\"elucubrate\\\", \\\"research\\\", \\\"revise\\\", \\\"swot\\\"], \\\"antonyms\\\": []}]\"','2000-01-01',0,'2000-01-01',0);
