INSERT INTO `` (`id`,`turkce`,`ing`,`konu`,`ses`,`okunus`,`ornekler`,`1_tarih`,`1_seviye`,`2_tarih`,`2_seviye`) VALUES (255,'test','test',' araç gereç','https://api.dictionaryapi.dev/media/pronunciations/en/test-uk.mp3','/test/','\"[{\\\"partOfSpeech\\\": \\\"noun\\\", \\\"definitions\\\": [{\\\"definition\\\": \\\"A challenge, trial.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A cupel or cupelling hearth in which precious metals are melted for trial and refinement.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"(academia) An examination, given often during the academic term.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"A session in which a product or piece of equipment is examined under everyday or extreme conditions to evaluate its durability, etc.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"(normally \\\\u201cTest\\\\u201d) A Test match.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"The external calciferous shell, or endoskeleton, of an echinoderm, e.g. sand dollars and sea urchins.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"Testa; seed coat.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"Judgment; distinction; discrimination.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}], \\\"synonyms\\\": [\\\"examination\\\", \\\"quiz\\\"], \\\"antonyms\\\": [\\\"recess\\\"]}, {\\\"partOfSpeech\\\": \\\"verb\\\", \\\"definitions\\\": [{\\\"definition\\\": \\\"To challenge.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": [], \\\"example\\\": \\\"Climbing the mountain tested our stamina.\\\"}, {\\\"definition\\\": \\\"To refine (gold, silver, etc.) in a test or cupel; to subject to cupellation.\\\", \\\"synonyms\\\": [], \\\"antonyms\\\": []}, {\\\"definition\\\": \\\"To put to the proof; to prove the truth, genuineness, or quality of by experiment, or by some principle or